import React from 'react'
import logo from './'



const Navbar = () => {
  return (
    <div>
        <div>
            <a href='#'>
                <img src='logo' alt='minerva' width={200} height={200} />
            </a>
        </div>
      </div>
  );
}

export default Navbar
